pragma solidity 0.5.7;
 
import "./interfaces/ITrade.sol";
import "./interfaces/IPreTrade.sol";
import "./interfaces/IPostTrade.sol";
import "./registry/Security.sol";
import "./interfaces/IOrderPool.sol";
import "./interfaces/IPoolFactory.sol";
import "./interfaces/ViaCash.sol";
import "./interfaces/ViaFactory.sol";
import "./utilities/StringUtils.sol";
import "abdk-libraries-solidity/ABDKMathQuad.sol";
import "@openzeppelin/upgrades/contracts/Initializable.sol";
import "@openzeppelin/contracts-ethereum-package/contracts/ownership/Ownable.sol";

contract Trade is ITrade, Initializable, Ownable{

    using ABDKMathQuad for uint256;
    using ABDKMathQuad for int256;
    using ABDKMathQuad for bytes16;

    using stringutils for *;

    struct order{
        address party;
        address security;
        bytes16 price;
        bytes16 trigger; 
        bytes32 otype;
        bytes32 order;
        bytes32 status;
        bytes32 currency;
        bytes32 securityName;
        uint256 qty;
        uint dt;
    }

    mapping(bytes32 => order) private orders;

    bytes32[] orderRefs;

    struct trade{
        address transferor;
        address transferee;
        address security;
        bytes16 price;
        bytes32 currency;
        bytes32 order;
        bytes32 stype;
        uint256 qty;
        uint dt;
    }

    mapping(bytes32 => trade) private trades;

    bytes32[] tradeRefs;

    address settlement;
    address registration;
    address orderpool;
    address poolfactory;
    ViaFactory private via;

    function initialize(address _viaFactory, address _settlement, address _registration, address _orderpool, address _poolfactory) public initializer{
        Ownable.initialize(msg.sender);
        settlement = _settlement;
        registration = _registration;
        orderpool = _orderpool;
        poolfactory = _poolfactory;
        via = ViaFactory(_viaFactory);
    }
 
    function reportTrade(address[] calldata a, bytes32[] calldata by, bytes16 _price, uint256 _qty) external {
        require(IPoolFactory(poolfactory).confirmPool(msg.sender)==true);
        bytes32 _tradeRef = keccak256(abi.encodePacked(by[0], by[1]));
        tradeRefs.push(_tradeRef);
        bytes32 cashTokenName = via.getName(a[2]);
        trades[_tradeRef]=trade(a[0], a[1], a[3], _price, cashTokenName, by[3], by[2], _qty, now);        
        (bytes32 _isin, bytes32 _company, address _token) = IPreTrade(registration).getSecurity(a[3]);
        if(by[2]=="DP"){
            bytes32 _transfereeDPID = IPreTrade(registration).getDP(a[1]);
            bytes32 _transferorDPID = IPreTrade(registration).getDP(a[0]);
            uint[] memory u = new uint[](2);
            u[0]=_qty;
            u[1]=ABDKMathQuad.toUInt(_price);
            bytes32[] memory b = new bytes32[](7);  
            b[0]=_isin;
            b[1]=_company;
            b[2]=_transferorDPID;
            b[3]=_transfereeDPID;
            b[4]=_tradeRef;
            b[5]=cashTokenName;
            b[6]=Security(trades[_tradeRef].security).name().stringToBytes32();
            address[] memory ad = new address[](3);
            ad[0]=a[0];
            ad[1]=a[1];
            ad[2]=a[3];
            IPostTrade(settlement).postSettlement(b, u, ad);
        }
        else if(by[2]=="STP"){
            if(ViaCash(a[2]).transferFrom(a[1], a[0], ABDKMathQuad.toUInt(_price)*_qty)){
                bool success = Security(_token).transferFrom(a[0], a[1], _qty);
                if(!success){
                    IOrderPool(msg.sender).revertTrade(by[0], _qty, "sell");
                    IOrderPool(msg.sender).revertTrade(by[1], _qty, "buy");
                    ViaCash(a[2]).transferFrom(a[0], a[1], ABDKMathQuad.toUInt(_price)*_qty);
                }
            }
        }
    }

    function reportOrder(address[] calldata a, uint256[] calldata u, bytes32[] calldata b, bytes16[] calldata by) external {
        require(IPoolFactory(poolfactory).confirmPool(msg.sender)==true);
        bytes32 _ref = b[0];       
        if(orders[_ref].party==address(0x0))
            orderRefs.push(_ref);
        orders[_ref].party = a[0];
        orders[_ref].price = by[0];
        orders[_ref].trigger = by[1];
        orders[_ref].qty = u[1];
        orders[_ref].order = b[1]; 
        orders[_ref].otype = b[2];
        orders[_ref].dt = u[0];
        orders[_ref].status = b[3];
        orders[_ref].currency = via.getName(a[1]);
        orders[_ref].securityName = Security(a[2]).name().stringToBytes32();
        orders[_ref].security = a[2];
    }

    function getOrders(bool originator) external view returns(bytes32[] memory){
        uint entries = orderRefs.length;
        bytes32[] memory result = new bytes32[](entries);
        uint entry=0;
        uint i;
        if(originator){
            for(i=0; i<orderRefs.length; i++){
                if(orders[orderRefs[i]].party==msg.sender){
                    result[entry]=orderRefs[i];
                    entry=entry+1;
                }
            }
        }
        else{
            for(i=0; i<orderRefs.length; i++){
                if(orders[orderRefs[i]].party!=msg.sender){
                    result[entry]=orderRefs[i];
                    entry=entry+1;
                }
            }
        }
        return result;
    }

    function getOrder(bytes32 ref) external view returns(bytes32[] memory, uint256[] memory){

        uint256[] memory u = new uint256[](4);
        u[0]= ABDKMathQuad.toUInt(orders[ref].price);
        u[1]= ABDKMathQuad.toUInt(orders[ref].trigger);
        u[2]= orders[ref].qty;
        u[3]= orders[ref].dt;
        bytes32[] memory b = new bytes32[](4);
        b[0]= orders[ref].currency;
        b[1]= orders[ref].securityName;
        b[2]= orders[ref].order;
        b[3]= orders[ref].status;
        return(b, u);
    }

    //returns bid, ask, last change corresponding to passed order ref
    function getTrade(bytes32 ref) external view returns(bytes16){//, bytes16){
        require(orders[ref].party==msg.sender);
        uint i;
        bytes16 bid;
        bytes16 ask;
        for(i=0; i<tradeRefs.length; i++){
            if(trades[tradeRefs[i]].security==orders[ref].security && trades[tradeRefs[i]].order=="Buy"){
                bid = trades[tradeRefs[i]].price;
            }
            if(trades[tradeRefs[i]].security==orders[ref].security && trades[tradeRefs[i]].order=="Sell"){
                ask = trades[tradeRefs[i]].price;
            }
        }
        //return (bid, ask);
        return bid;
    }

    function editOrder(address[] calldata a, uint[] calldata u, bytes32[] calldata b, bytes16[] calldata by) external{
        require(IPoolFactory(poolfactory).confirmPool(msg.sender)==true);
        bytes32 _ref = b[0];
        if(orders[_ref].party!=address(0x0)){
            orders[_ref].party = a[0];
            orders[_ref].price = by[0];
            orders[_ref].trigger = by[1];
            orders[_ref].qty = u[1];
            orders[_ref].order = b[1];
            orders[_ref].otype = b[2];
            orders[_ref].dt = u[0];
            orders[_ref].status = b[3];
            orders[_ref].currency = via.getName(a[1]);
            orders[_ref].securityName = Security(a[2]).name().stringToBytes32();
            orders[_ref].security = a[2];
        }
    }

    function cancelOrder(bytes32 _ref, bytes32 _status) external{
        require(IPoolFactory(poolfactory).confirmPool(msg.sender)==true);
        if(orders[_ref].party!=address(0x0)){
            orders[_ref].status = _status;
        }
    }
    
}
